import React from "react";

const Header = () => {
  return (
    <>
      <h1 className="header">
        <img
          src="https://cdn-icons-png.flaticon.com/512/2965/2965358.png"
          alt="logo"
        />
      </h1>
    </>
  );
};

export default Header;
